(15, 1, 1, 'AUDI', '<p>Audi в нынешнем виде является наследником концерна Auto Union, образованного в результате объединения четырёх компаний, выпускавших автомобили и мотоциклы под марками DKW, Horch, Audi и Wanderer. Вследствие преобразований была оставлена лишь торговая марка Audi. [источник не указан 562 дня] Первый автомобиль марки Wanderer появился в 1913 г., первое собственное предприятие (Horch &amp; Co.) Август Хорьх организовал в 1899 г, а после того, как кредиторы отстранили его от дел, в 1909 г. была организована компания Audi Automobil-Werke, что переводится как «Автомобильный завод Ауди». А в 1910 г. был выпущен первый автомобиль. В переводе с немецкого Хорхь (Horch) означает «слушай». Когда выбирали название для новой марки, сын одного из деловых партнёров Августа предложил то же слово, но только в латинском варианте, то есть «Audi»[источник не указан 1405 дней]. В 1921 фирма совершила своеобразный прорыв. В этом году был выпущен первый немецкий автомобиль с левосторонним расположением рулевого управления. До этого фирма занималась лишь двигателями и подвесками, теперь же она стала обращать внимание и на удобство управления. В 1928 эта марка была выкуплена мотопроизводителем DKW, и в 1931 состоялся дебют первого в мире автомобиля с передним приводом, DKW F1. Содействовал этому мировой экономический кризис, начавшийся в 1929. Дело в том, что автомобили с большим объёмом двигателя перестали пользоваться спросом ввиду всеобщего безденежья. И тогда глава Audi поручил разработать компактный автомобиль с передним приводом.</p>', 'audi', '', '', ''),
