INSERT INTO `ps_manufacturer_lang` (`id_manufacturer`, `id_lang`, `description`, `short_description`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, '', '', '', '', ''),
(1, 2, '', '', '', '', ''),
(2, 1, '<p>Robert Bosch GmbH (произносится: Ро́берт Бош ГмбХ) — немецкая группа компаний, ведущий мировой поставщик технологий и услуг в области автомобильных и промышленных технологий, потребительских товаров, строительных и упаковочных технологий.Компания была основана немецким предпринимателем и инженером Робертом Бошем 15 ноября 1886 года. Главный офис компании расположен в городе Герлинген, Германия, недалеко от Штутгарта.По предварительным данным, в 2015 году компания Bosch вложила в научные исследования и разработки около 6,3 млрд евро, а также подала заявки на получение 5422 патентов по всему миру. Около 375 000 сотрудников обеспечили в 2015 финансовом году рекордный для компании оборот в 70 млрд евро.В Группу компаний Bosch входят Robert Bosch GmbH и примерно 440 дочерних предприятий и региональных компаний приблизительно в 60 странах. Вместе с партнерами в сфере продаж и обслуживания компания Bosch представлена почти в 150 странах.[2]С 1 июля 2012 г. председателем правления является Фолькмар Деннер (Volkmar Denner).</p>', '<p>Robert Bosch GmbH (произносится: Ро́берт Бош ГмбХ) — немецкая группа компаний, ведущий мировой поставщик технологий и услуг в области автомобильных и промышленных технологий, потребительских товаров, строительных и упаковочных технологий.Компания была основана немецким предпринимателем и инженером Робертом Бошем 15 ноября 1886 года. Главный офис компании расположен в городе Герлинген, Германия, недалеко от Штутгарта.</p>', '', '', ''),
